import React from 'react';
import { Container, Typography, Button } from '@mui/material';

const HomePage = () => {
  return (
    <Container>
      <Typography variant="h2" align="center" gutterBottom>
        Welcome to the Game of Life!
      </Typography>
      <Typography variant="body1" align="center" paragraph>
        The Game of Life is a classic cellular automaton invented by John Conway in 1970. In this game, each cell's life and death depend on the state of its surrounding neighbors, simulated based on a set of simple rules.
      </Typography>
      <Typography variant="body1" align="center" paragraph>
        Click the button below to start playing!
      </Typography>
      <Button variant="contained" color="primary" fullWidth href="/simulation">
        Start Playing
      </Button>
    </Container>
  );
};

export default HomePage;
